import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Transition } from "arclight-react";

const Constraints = styled.div`
  position: relative;
  padding: 100%;
  width: 100%;
`;

const Card = styled.div`
  background-color: blue;
  width: 100%;
  padding-top: 425%;
  margin-top: -100%;
  overflow-y: hidden;
  & img {
    opacity: 0.1;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
  }
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Transition>
          <Constraints>
            <Card>
              <img src={require("./img/yone.jpg")} />
              <img src={require("../../../config/assets/border.png")} />
            </Card>
          </Constraints>
        </Transition>
      </ThemeProvider>
    );
  }
}
